	    PyArrayObject *ary = obj_to_array_no_conversion(input, NPY_FLOAT);
	
	    if (ary == NULL) return;
	
	    if (!require_contiguous(ary))
	        SWIG_Error(0, "Input numpy array is not contiguous");
	
